import React from 'react';

const Navbar = () => {
  return (
    <nav className="navbar navbar-dark bg-dark mb-5">
      <span className="navbar-brand mb-0 h1 mx-auto">About</span>
      <span className="navbar-brand mb-0 h1 mx-auto">Projects</span>
      <span className="navbar-brand mb-0 h1 mx-auto">Contact</span>
      <span className="navbar-brand mb-0 h1 mx-auto">Resume</span>
    </nav>
  );
};
export default Navbar;
